import dwarwes from "./dwarwes";
import styles from './dwarwes.module.css'


export default function DwarfCard(props) {
  return (<div className={styles.cards}>
    <h3>{props.name}</h3>
    <p>{props.age}</p>
    <p>{props.primaryWeapon}</p>

  </div>)
}
